var socket=!1;function socket_start(){socket_check()||(console.log("WebSocket Started"),socket=socket_server());try{socket.onopen=function(o){console.log("socket initialized")},socket.onmessage=function(o){var e=JSON.parse(o.data);console.log(e)},socket.onclose=function(o){console.log({closed:socket})}}catch(o){console.log(o)}}function socket_server(){console.log("Socket Initialized");var o="/ajax/server";if(window.EventSource)e=new WebSocket(o);else var e=new EventSource(o);return e}function socket_stop(){null!=socket&&(console.log("WebSocket Stopped"),socket.close(),socket=null)}function socket_check(){return socket}